import { useSelector } from "react-redux";
import FormInput from "./components/FormInput";
import TableCompo from "./components/TablularCompo";

function CombineShow() {
    const localData = useSelector((state) => {
        return state
    })
    
    
    return <div >
        <FormInput />
        <TableCompo localData={localData}/>
    </div>
}
export default CombineShow
